import * as React from 'react';
import classnames from 'classnames';
import PropTypes from 'prop-types';

import styles from './Button.module.css';


const Button = ({
	children: label,
	className,
	fluid,
	icon: Icon,
	...others
}) => (
	<button
		{...others}
		className={classnames(
			styles.Button,
			className,
			{
				[styles.fluid]: fluid,
			},
		)}
	>
		{!!Icon
			? Icon
			: label
		}
	</button>
);
Button.APPEARANCES = {
	AFFIRMING: 'affirming',
	BASIC: 'basic',
	DANGER: 'danger',
	PRIMARY: 'primary',
	WARNING: 'warning',
};
Button.TYPES = {
	BUTTON: 'button',
	SUBMIT: 'submit',
};
Button.VARIANTS = {
	CTA: 'cta',
	GLYPH: 'glyph',
};
Button.defaultProps = {
	appearance: Button.APPEARANCES.PRIMARY,
	fluid: false,
	type: Button.TYPES.BUTTON,
	variant: Button.VARIANTS.CTA,
};
Button.propTypes = {
	appearance: PropTypes.oneOf(Object.values(Button.APPEARANCES)),
	fluid: PropTypes.bool,
	type: PropTypes.oneOf(Object.values(Button.TYPES)),
	variant: PropTypes.oneOf(Object.values(Button.VARIANTS)),
};

Button.Group = ({ className, ...props }) => (
	<Group className={classnames(className, styles.ButtonGroup)} {...props} />
);

export default Button;

import * as React from 'react';
import classnames from 'classnames';
import _map from 'lodash-es/map.js';
import { PureComponent } from 'react';

import Button from '../Button/index.jsx';

import styles from './FileInput.module.css';


export default class FileInput extends PureComponent {
	static defaultProps = {
		icon: (<span></span>),
		label: 'Select file(s)',
		multiple: false,
		onChange: () => {},
	}

	state = {
		previews: new Array(0),
	};

	handleChange = (e, cb) => {
		const { files } = e.target;

		if (!files?.length) return console.error('[File Preview] Files is empty');

		this.setState({
			previews: _map(files, this.handlePreviews),
		});

		cb(e, files);
	};

	handlePreviews(file) {
		const output = { __proto__: null };
		output.file = file;

		if (file.type.match('image.*')) {
			output.preview = URL.createObjectURL(file);
		}

		return output;
	};

	componentWillUnmount() {
		for (const { preview } of this.state.previews) {
			URL.revokeObjectURL(preview);
		}
	}

	render() {
		const {
			handleChange,
			props: {
				accept,
				className,
				icon,
				label,
				multiple,
				name,
				onChange,
			},
			state: {
				previews,
			},
		} = this;

		return (<>
			{!!previews.length && (
				<div className={styles.FileInputPreviews}>
					{_map(previews, ({
						file: { name },
						preview
					}) => {
						if (preview) return (
							<img
								className={styles.FileInputPreview}
								key={name}
								src={preview}
							/>
						);

						return (<p key={name}>{name}</p>);
					})}
				</div>
			)}

			<label
				className={classnames(styles.FileInput, className)}
				htmlFor={name}
			>
				<Button
					appearance={Button.APPEARANCES.BASIC}
					className={styles.FileInputButton}
					icon={icon}
				>
					{label}
				</Button>
				<input
					accept={accept}
					className={styles.FileInputControl}
					id={name}
					multiple={multiple}
					name={name}
					onChange={(e) => handleChange(e, onChange)}
					type="file"
				/>
			</label>
		</>);
	}
}

import * as React from 'react';
import classnames from 'classnames';
import _isEmpty from 'lodash-es/isEmpty.js';
import _map from 'lodash-es/map.js';
import PropTypes from 'prop-types';
import { useState } from 'react';

import styles from './Input.module.css';


const Input = ({
	arrangement,
	as: Field,
	className,
	fluid,
	inline,
	label,
	name,
	id = name, // must come after `name`
	onBlur,
	onChange,
	options,
	type,
	value,
	...others
}) => {
	const [error, setError] = useState('');
	const [pristine, setPristine] = useState(true);
	const [touched, setTouched] = useState(false);

	if (options) others.list = `${name}_options`;

	others.onBlur = (e) => {
		setTouched(true);
		if (e.target.checkValidity()) setError('');
		onBlur(e);
	};

	others.onChange = (e) => {
		setPristine(false);
		setTouched(true);

		if (e.target.checkValidity()) setError('');

		let {
			checked,
			name,
			type,
			value,
		} = e.target;

		if (type === 'checkbox') value = checked;

		onChange({
			name,
			value: options?.[value] || value,
		}, e);
	}

	return (
		<div
			arrangement={arrangement}
			className={classnames(
				styles.InputField,
				{
					[styles.inline]: inline,
					[styles.fluid]: fluid,
				},
			)}
		>
			<Field
				className={classnames(styles.Input, {
					[styles.fluid]: fluid,
				})}
				name={name}
				id={id}
				onInvalid={(e) => {
					e.nativeEvent.stopImmediatePropagation();
					setError(e.target.validationMessage);
					setTouched(true);
				}}
				pristine={pristine ? 'true' : null}
				touched={touched ? 'true' : null}
				type={type}
				value={value}
				{...others}
			/>
			{!!label && (<label
				className={styles.Label}
				htmlFor={id}
			>{label}</label>)}
			{!!error && (
				<dialog
					className={styles.Error}
					data-testid="input-error"
					open
				>{error}</dialog>
			)}
			{!_isEmpty(options) && (
				<datalist data-testid={others.list} id={others.list}>{_map(options, (label, key) => (
					<option key={key} value={key}>{label}</option>
				))}</datalist>
			)}
		</div>
	);
};
Input.ARRANGEMENTS = {
	INLINE: 'inline',
	STACKED: 'stacked',
	STAND_ALONE: 'stand-alone',
};
Input.VARIANTS = {
	TOGGLE: 'toggle',
};
Input.defaultProps = {
	arrangement: Input.ARRANGEMENTS.INLINE,
	as: 'input',
	onBlur() {},
	onChange() {},
	type: 'text',
};
Input.propTypes = {
	arrangement: PropTypes.oneOf(Object.values(Input.ARRANGEMENTS)),
	as: PropTypes.elementType,
	label: PropTypes.string,
	name: PropTypes.string.isRequired,
	options: PropTypes.object,
	variant: PropTypes.oneOf(Object.values(Input.VARIANTS)),
};

export default Input;

import * as React from 'react';
import _reduce from 'lodash-es/reduce.js';

import classNames from 'classnames';
import { PureComponent } from 'react';
import PropTypes from 'prop-types';

import composeData, {
	FIELD_TAGS,
} from '../composeData.js';
import deepDiff from '../deepDiff.js';

import styles from './Form.module.css';


export default class Form extends PureComponent {
	static FIELD_TAGS = FIELD_TAGS;

	initValues = { __proto__: null };

	setRef = (el) => {
		if (!el) return;

		this.initValues = _reduce(
			[...el.elements],
			composeData,
			this.initValues,
		);
	};

	onSubmit = (event, initValues, cb) => {
		event.preventDefault();

		if (!event.target.reportValidity()) return;

		event.stopPropagation();

		const values = _reduce(
			[...event.target.elements],
			composeData,
			{ __proto__: null },
		);

		const delta = deepDiff(initValues, values);

		this.initValues = values; // reset starting values for potential subsequent submit

		return cb(delta, values, event);
	};

	render() {
		const {
			onSubmit,
			initValues,
			props: {
				children,
				className,
				onSubmit: pOnSubmit,
				...props
			},
			setRef,
		} = this;

		return (
			<form
				{...props}
				className={classNames(styles.Form, className)}
				noValidate
				onSubmit={(e) => onSubmit(e, initValues, pOnSubmit)}
				ref={setRef}
			>
				{children}
			</form>
		);
	}
}

Form.propTypes = {
	onSubmit: PropTypes.func.isRequired,
};
